import React from "react";

const Header = (props) => {
    const { handleContentBodyChange }= props;
    return(
        <div className="row justify-content-end">
            <button onClick={handleContentBodyChange}></button> | Skills | Projects | Contact
        </div>
    )
}

export default Header;
